import React, {useState,useEffect} from 'react';
import Select from 'react-select';
import { Button,Container,Row,Col } from 'reactstrap';
import './search.css';



function Search() {
  const [list, setList] = useState([])


  useEffect(()=>{
    fetch('https://randomuser.me/api/?results=50')
    .then(res => {
      return res.json()
    })
    .then(response => {
      var data = {
        photo:response.results.picture.thumbnail,
        name:response.results.name.title + response.results.name.first + response.results.name.last,
      }
      console.log(data);
    })
  },[])

  // .then((data) => {setList()})
  return (
    <Container className="container-content" fluid="sm">
      <Row>
        <Col sm="12" md={{ size: 8, offset: 2 }}>
          <Select className="search-box"  />
        </Col>
      </Row>
    </Container>
  );
}

export default Search;
